import React from "react";

function HeaderForms (){
    return (
        <header>
        <h1 class="title">Team Sign Up</h1>
        <nav class="navegacao">
          <ul>
            <li class="active">Basic</li>
            <li>Social</li>
            <li>Certificates</li>
          </ul>
        </nav>
      </header>
    );
}

export default HeaderForms;
